sys_variable_value.value:
(function execute(inputs, outputs) {

  try {
    var r = new sn_ws.RESTMessageV2('x_tesgh_veeam_app.Veeam Server', 'Get Session Logs');
    r.setStringParameterNoEscape('baseUrl', inputs.baseurl);
    r.setStringParameterNoEscape('token', inputs.token);
    r.setStringParameterNoEscape('sessionId', inputs.sessionId);    
	if (inputs.midServerName) r.setMIDServer(inputs.midServerName);

    var response = r.execute();

    outputs.response_body = response.getBody();
    outputs.http_status = response.getStatusCode();
  }
  catch(ex) {
    outputs.error_message = ex.message;
  }

})(inputs, outputs);

